import React from "react";
var ctime = new Date();
ctime = ctime.getHours();
var greet;
let cstyle = {
  color: "",
  fontSize: 35,
};
if (ctime <= 12) {
  greet = "Good morning";
  cstyle.color = "red";
} else if (ctime <= 18) {
  greet = "Good Afternoon";
  cstyle.color = "green";
} else {
  greet = "Good Night";
  cstyle.color = "blue";
}
function Time(){

return <h1 style={cstyle}>{greet}</h1>;

}

export default Time;
